// Secret.js
import React from 'react';
import { useSecret } from './SecretContext';

const Secret = () => {
  const { getSecret } = useSecret();
  const secrets = JSON.parse(sessionStorage.getItem('secrets')) || {};

  return (
    <div>
      <h2>Secrets</h2>
      <ul>
        {Object.keys(secrets).map(key => (
          <li key={key}>
            {secrets[key].description}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Secret;
